import React, { useState, useEffect } from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from "../components/header/header"
import Footer from "../components/footer/footer"
import Nav from "../components/navigation/nav"
import Slider from "../components/slider/slider"
import Home from "./home/home"
import History from './department/history/history';
import MyMap from './contacts/contacts';
import Staff from './department/staff/staff';
import LoadingScreen from '../components/loading/loadingScreen';
import Data from "../data/teachers.json";
import LoginForm from '../components/LoginForm/loginForm';
import RegistrationForm from '../components/RegistrationForm/registrationForm';
import News from './news_events/news';




const Main = () => {
    const [loading, setLoading] = useState(true);
    const [data, setData] = useState(Data)


    useEffect(() => {
        // Your code to fetch data or load assets
        setLoading(false); // Set loading to false when done
    }, []);
    return (
        <div>
            {loading ? <LoadingScreen /> : <div><Router>
                <div>
                    <Header />
                    <Nav />
                    <Slider />
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="/history" element={<History />} />
                        <Route path="/contacts" element={<MyMap />}/>
                        <Route path="/staff" element={<Staff
                            data={data} />}/>
                        <Route path="/news" element={<News/>}/>
                        <Route path="/register" element={<RegistrationForm/>}/>
                        <Route path="/login" element={<LoginForm/>}/>
                        <Route></Route>
                    </Routes>
                    <Footer />
                </div>
            </Router></div>}



        </div>
    )
}
export default Main
